import React, { useEffect } from 'react'
import './Home.css'
import { Header } from '../../Components/Header'
import { Post } from '../../Components/Post/Post'


export const Home = () => {

  useEffect(()=>{
    fetch('http://localhost:9000/post').then(response =>{
      response.json().then(posts=>{
        console.log(posts)
      })
    })
  })

  return (
    <div className="all">
    <Header/>
    <div className="posts">
    <Post/>

    </div>
    </div>
  )
}
